            if not self.nodes[child].parent:
                self.nodes[child].parent = self.nodes[child]
                return self.nodes[child]
        return None

    def _build_queue(self, node):
        queue = deque()
        for child in node.children:
            queue.append(child)
            if not child.parent:
                return queue
        return queue

    def build_heap(self):
        queue = deque()
        queue.append(self.root)
        while queue:
            node = queue.pop()
            for child in node.children:
